(4, 'dehydration', 'DEHYDRATION', '1563177399_dehydration.png', '<p><strong>Dehydration</strong>&nbsp;is the elimination of more of liquid than you take&nbsp;And your body dont have enough water for the normal functioning of&nbsp;body.</p>\r\n\r\n<p>This problem happens due to sweating, Tears,or by splitting(saliva).</p>\r\n\r\n<p>SYMPTOMS OF DEHYDRATION IN INFANTS AND&nbsp;CHILDREN:</p>\r\n\r\n<ul>\r\n	<li>Sunken eyes,cheeks</li>\r\n	<li>Irritability</li>\r\n	<li>Dry mouth and tongue</li>\r\n	<li>No tears when crying</li>\r\n</ul>\r\n\r\n<p>SYMPTOMS OF DEHYDRATION IN ADULTS:</p>\r\n\r\n<ul>\r\n	<li>Extreme thirst</li>\r\n	<li>Less frequent urination</li>\r\n	<li>Fatigue</li>\r\n	<li>Dizziness</li>\r\n</ul>\r\n\r\n<p>TIPS TO REDUCE DEHYDRATION:</p>\r\n\r\n<ul>\r\n	<li>Tender Coconut is one of the helpful food which a person can take to prevent themselves from dehydration ,also &nbsp;tender coconut enhances the immunity power and contains high fibre content.</li>\r\n	<li>Avoid oily and spicy foods.</li>\r\n	<li>Do Yoga early in the morning as it makes the person stress free and more active.&nbsp;</li>\r\n	<li>Eat small and frequent meals because small meals can easily get digested in our body and helps in the better digestion.</li>\r\n	<li>Avoid alcoholic beverages.</li>\r\n	<li>Avoid high protein diet because it sometimes creates dehydration.</li>\r\n</ul>\r\n\r\n<p>TIPS TO REDUCE DEHYDRATION BEFORE,DURING AND AFTER EXERCISE:</p>\r\n\r\n<ul>\r\n	<li>Drink a cup of water about 4 Hours before exersise.</li>\r\n	<li>Have another cup of water every 10-15 min while doing exersise.</li>\r\n	<li>Drink after you are done with exercise.</li>\r\n</ul>\r\n\r\n<p>HEALTHY RECIPE TO PREVENT DEHYDRATION:</p>\r\n\r\n<p>BARLEY WATER - RECIPE :</p>\r\n\r\n<ul>\r\n	<li>Soak a cup of barley in water.</li>\r\n	<li>Boil the same water and let it cool and strain after cooling.</li>\r\n	<li>Now add lemon juice ,salt and honey in it for taste.</li>\r\n</ul>\r\n\r\n<p>OTHER USE:</p>\r\n\r\n<ul>\r\n	<li>Encourge weight loss.</li>\r\n	<li>Lowers blood sugar level.</li>\r\n	<li>Lower risk of cardiovascular problems.</li>\r\n</ul>\r\n\r\n<p>MANGO PANNA -&nbsp;RECIPE:</p>\r\n\r\n<ul>\r\n	<li>Boil the raw mango and take out its peel.</li>\r\n	<li>Boil the raw mango and take out its peel.</li>\r\n	<li>Now take few spoons of pulpy mango in glass and add chilled water in it,and add some salt and honey in it and mix it well.</li>\r\n</ul>\r\n\r\n<p>OTHER USES:</p>\r\n\r\n<ul>\r\n	<li>Cures digestive disorder.</li>\r\n	<li>As mango panna or Aam panna is rich in Vitamin A, so it protects eyes.</li>\r\n	<li>Reduce the blood pressure levels.</li>\r\n</ul>\r\n', '2019-07-15 20:26:00', 1, 0),
