uscular function</p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><strong>Vitamin D Deficiency Disorders and Diseases1</strong></p>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Rickets &ndash; a disorder where bones become soft and deformed due to improper mineralization</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Osteoporosis and osteomalacia</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Falls</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Cancer of prostrate, colon, breast, lung, marrow/lymphoma,&nbsp;</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Periodontal disease</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Susceptibility/poor response to infection</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Hypertension</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Multiple sclerosis&nbsp;</p>\r\n\r\n	<ul>\r\n		<li dir=\"ltr\">\r\n		<p dir=\"ltr\">Deficiency during pregnancy can lead to development of multiple sclerosis in infants as well</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Cognitive impairment in adults</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Studies have also shown increased risk of death from Cardio Vascular Disease, type 1 and type 2 Diabetes and glucose intolerance. Though more investigation and research is required to prove it.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><strong>Test for Deficiency</strong></p>\r\n\r\n<p dir=\"ltr\">25-hydroxy vitamin D blood test is recommended to identify the deficiency in the body.</p>\r\n\r\n<p dir=\"ltr\">20 nanograms/millilitre - 50 nanograms/millilitre is considered adequate for healthy people.</p>\r\n\r\n<p dir=\"ltr\">&lt;12 nanograms/millilitre is considered a deficiency.</p>\r\n\r\n<p dir=\"ltr\"><strong>How Frequently Should I go for Vitamin D Test?</strong></p>\r\n\r\n<p dir=\"ltr\">Although there&rsquo;s no defined period of check for Vitamin D levels in the body, one should go for tests if any or all of the above symptoms are noticeable. Doctor&rsquo;s will prescribe tests as per your medical conditions.</p>\r\n\r\n<p dir=\"ltr\"><strong>How to Improve Vitamin D Deficiency?</strong></p>\r\n\r\n<p dir=\"ltr\">Taking external supplements and fortified dairy and grain products will help to replenish the deficiency of Vitamin D in the body. Right exposure to the sun, controlled weight and healthy diet are also ways to keep fit and mitigate Vitamin D deficiency.</p>\r\n\r\n<p dir=\"ltr\"><strong>References</strong>:</p>\r\n\r\n<p dir=\"ltr\">1) &ldquo;Vitamin D in Health and Disease&rdquo;, Robert P.&nbsp;Heaney, CJASN&nbsp;Sep&nbsp; 2008,&nbsp;3&nbsp;(5)&nbsp;1535-1541;&nbsp;DOI:&nbsp;10.2215/CJN.01160308</p>\r\n\r\n<p dir=\"ltr\">2)&nbsp;<a href=\"https://ods.od.nih.gov/factsheets/VitaminD-HealthProfessional/\">https://ods.od.nih.gov/factsheets/VitaminD-HealthProfessional/</a></p>\r\n\r\n<p>3)&nbsp;<a href=\"https://www.healthline.com/nutrition/vitamin-d-deficiency-symptoms#section4\">https://www.healthline.com/nutrition/vitamin-d-deficiency-symptoms#section4</a></p>\r\n\r\n<p>4)&nbsp;<a href=\"https://cosmosmagazine.com/biology/vitamin-d-s-moment-in-the-sun-it-prevents-and-relieves-chronic-diseases\">https://cosmosmagazine.com/biology/vitamin-d-s-moment-in-the-sun-it-prevents-and-relieves-chronic-diseases</a></p>\r\n', '2019-08-21 22:46:00', 1, 1);
