INSERT INTO `testimonials` (`id`, `name`, `designation`, `image`, `content`, `post_date`, `type`, `is_active`, `is_deleted`) VALUES
(4, 'Shiba Prasad', 'Senior Web UI/UX and Graphic Designer', '1516474495_sonal1.png', '<p>I have always received great services from Dr. Das Pathlab. Timing&nbsp;and quality have always met my expectations and everything is communicated in a professional and timely manner.</p>\r\n', '2018-01-21 07:24:00', 1, 1, 0),
(5, 'Dev Kishore', 'Technical Consultant', '1538803151_IMG-20180418-WA0013.jpeg', '<p>Dr. Das Pathlab provides quality diagnostic services, within the promised time and that too, in a cost-effective manner. The staff is highly skilled and take the samples with complete sanitation, Dr. Das Pathlab is worth opting for.</p>\r\n', '2018-01-21 09:04:00', 1, 1, 0),
(6, 'Nitin Jain', 'Head Technology', '1516480588_Ayesha-Verma.png', '<p>The need to visit the lab for collecting reports of a sample gets eliminated if you choose Dr. Das Pathlabs for your diagnostic services. The online facility is very tech-friendly and easy to use. The reports are easily downloaded with the help of given username and password.</p>\r\n', '2018-01-21 09:06:00', 1, 1, 0),
(7, 'Mr. Kamra', 'Country Head', '1516480642_tohan.png', '<p>Excellent services, highly skilled staff, clean materials and all the tests can be done at one location. Dr. Das Pathlabs also give prior information about the pre-requisites related to the diagnosis which proves them to be highly professional and customer friendly at the same time.</p>\r\n', '2018-01-21 09:07:00', 1, 1, 0),
(8, 'Mr. Chugh', 'Business Man', '1516480710_Nipun.png', '<p>The tests and services are very accurate and cost effective. The staff is very professional and I always opt for Dr. Das Pathlab for any small or big diagnostic for myself or my family. I am highly satisfied.</p>\r\n', '2018-01-21 09:08:00', 1, 1, 0),
(9, 'Rohit', 'Node js Developer', '1516480757_Anuraag-Gambhir.png', '<p>I had to get my grand parents and parents regularly tested form them for ages. Since the facility to get the sample picked from home and getting the report on a e-mail has been introduced, it has eliminated a major hassle from my life. My doctor trusts their results and I get best prices as compared to other available options. I would strongly recommend Dr.Daspathlab to everyone.</p>\r\n', '2018-01-21 09:09:00', 1, 1, 1);
